      re =
        "/** @jsx jsx */\nimport {\n  jsx,\n  List,\n  ListItem,\n  ListItemText,\n  Container,\n  CircularProgress,\n  styled\n} from '@wonder-ui/core';\nimport { useDynamicList } from '@wonder-ui/hooks';\nimport * as React from 'react';\n\nconst Indicator = styled('div')`\n  display: flex;\n  height: 44px;\n  align-items: center;\n  justify-content: center;\n`;\n\nconst dataList = Array(10).fill('');\n\nexport default function Example() {\n  const { list, merge } = useDynamicList(dataList);\n  const scrollRef = React.useRef<HTMLDivElement>(null);\n\n  const handleScroll = () => {\n    const node = scrollRef.current;\n    if (node) {\n      if (node.scrollTop === node.scrollHeight - node.offsetHeight) {\n        setTimeout(() => {\n          merge(list.length - 1, dataList);\n        }, 1000);\n      }\n    }\n  };\n\n  return (\n    <Container size=\"sm\">\n      <div\n        ref={scrollRef}\n        onScroll={handleScroll}\n        style={{\n          height: '300px',\n          overflow: 'auto',\n          WebkitOverflowScrolling: 'touch'\n        }}\n      >\n        <List>\n          {list.map((item, index) => (\n            <ListItem key={index}>\n              <ListItemText>Item {index}</ListItemText>\n            </ListItem>\n          ))}\n        </List>\n        <Indicator>\n          <CircularProgress size={22} />\n        </Indicator>\n      </div>\n    </Container>\n  );\n}",
